import React, { useEffect, useState } from 'react';
import axios from 'axios';
import logo from './logo.svg';
// import './App.css';
import { BASE_URL } from './apiConfig'; // Import the BASE_URL
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import EarthquakeSite from './earthquake'
import WeatherSite from './weather'
// import Homepage from './home'
import NewHome from './newhome'
import About from './about'
import Header from './layouts/header'
// import Table from './table'

function App() {

  return (
    <div className="App">
        <Router>
          <Routes>
          
          <Route path ="/earthquake" element = {<EarthquakeSite/>} />
          <Route path ="/weather" element = {<WeatherSite/>} />
          {/* <Route path = "/" element = { <Homepage/> } />  */}
          <Route path = "/" element = { <NewHome/> } /> 
          <Route path = "/about" element = { <About/> } /> 
          {/* <Route path ="/table" element = {<Table/>} /> */}
          </Routes>
        </Router>
    </div>
  );
}

export default App;
